import './section.css'
import {Card, CardBody, Col, Row} from "reactstrap";


const Section = () => {
    return (
        <div className='section'>
            <div className='text-center'>
                <h1>Услуги</h1>
            </div>
            <Row className='m-lg-5'>
                <Col md={3}>
                     <Card>
                         <CardBody>
                             iawhduah
                         </CardBody>
                     </Card>
                </Col>

            </Row>
        </div>
    );
};

export default Section;
